import React from "react";

export default class MyForm extends React.Component {
  state = {
    name: "xxx"
  };

  handleChange = event => {
    console.log(event.target.value);
    this.setState({ name: event.target.value });
  };

  render() {
    return (
      <div>
        <input value={this.state.name} onChange={this.handleChange} />
      </div>
    );
  }
}
